class Patient extends Component {
    constructor(props){
        super();

    }

    getSickCode = (id)=>{
        console.log(id);
        this.props.getSickbypatient(id);

      } 

  render() {
    return (
        <div className="col-md-3">
        <a href="#">
                                <span>Sick</span>
                                <span className="pull-right-container">
                                </span>
                            </a>
         </div>
    )
  }
}

export default Patient;
